  gd.on('plotly_click', function(ev){
    if(!ev || !ev.points || !ev.points.length) return;
    var p = ev.points[0];
    var cd = p.customdata || [];
    var site = cd[0], rec = cd[1], ego = cd[2], nb = cd[3], frame = cd[4], dReal = cd[5];
    var txt = "<b>site</b>: " + site
            + " | <b>recordingId</b>: " + rec
            + " | <b>egoId</b>: " + ego
            + " | <b>neighborId</b>: " + nb
            + " | <b>frame</b>: " + frame
            + " | <b>dTCA_first (real)</b>: " + dReal.toFixed(3) + " m";
    var box = document.getElementById("details_exiD_5");
    if(box) box.innerHTML = "<b>Details:</b> " + txt;
  });
})();
</script>
